import React from 'react'

const Home = () => {
  return (
    <div className="home-page">
      <div class="progress">
        <div class="progress-bar w-75" role="progressbar" aria-valuenow="75" aria-valuemin="0" aria-valuemax="100"></div>
      </div>
    </div>
  )
}

export default Home
